  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Arrowwood
  Waterfowl Production Area outlines Refuge accomplishments during the 1967 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  mammals, and fish- is also covered. The Refuge development and maintenance section
  discusses physical developments, plantings, collections and receipts, and vegetation
  control. Resource management is outlined; topics include grazing, haying, and fur
  harvesting. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, Refuge participation, hunting, and safety. Items of interest, N-R
  forms, and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
